import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";

import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import CircleIcon from '@mui/icons-material/Circle';
import ListItemIcon from '@mui/material/ListItemIcon';
import LooksOneIcon from '@mui/icons-material/LooksOne';

import Navbar from "./Navbar";
import '../styles/Confirm.css'

const Confirm = () => {

    const [check, setCheck] = useState([]);
    const handleChange = () => {
        setCheck(!check);
    };

    const [show, setShow] = useState(false);



    return (
        <>
            <Navbar />
            <div className="confirm-content">
                <h1>Så här går du tillväga</h1>
                <List>
                    <ListItem>
                        <ListItemIcon>
                            <LooksOneIcon fontSize='large' />
                        </ListItemIcon>
                        <ListItemText>
                            Lägg kläderna i samma kartong som de kom i.
                        </ListItemText>
                    </ListItem>
                    <ListItem>
                        <ListItemIcon>
                            <LooksOneIcon fontSize='large' />
                        </ListItemIcon>
                        <ListItemText>
                            Ta med kartongen till Nacka Kommun.
                        </ListItemText>
                    </ListItem>
                    <ListItem>
                        <ListItemIcon>
                            <LooksOneIcon fontSize='large' />
                        </ListItemIcon>
                        <ListItemText>
                            Vid inlämning av ditt paket sker utlämning av nytt paket.
                        </ListItemText>
                    </ListItem>
                    <ListItem>
                        <ListItemIcon>
                            <LooksOneIcon fontSize='large' />
                        </ListItemIcon>
                        <ListItemText>
                            Du får en notis i appen när du har lämnat och hämtat upp ditt nya paket. 
                        </ListItemText>
                    </ListItem>
                </List>
                <FormGroup>
                    <FormControlLabel control={<Checkbox onChange={handleChange} onClick={() => setShow(!show)} />} label="Jag har läst och förstått instruktionerna" />
                </FormGroup>
                <div>
                    {
                      show && <button className='selectBTN'>OKEJ</button>
                    }
                </div>
            </div>
        </>
    );
}

export default Confirm;
